import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
class ItemLibrary extends React.Component {
    render() {
        return (
            <>
                 <li className="itemLibrary">
                    <a href="123" className="item-librarylink">
                        <FontAwesomeIcon className="icon-library" icon={this.props.item.icon}/>
                        <span className="text-library">{this.props.item.title}</span>
                    </a>
                </li>
            </>
        );
    }
}

export default ItemLibrary;
